    <div style = {{textAlign: "center"}}>
      <h1>CS5610 Mini Assingment 3</h1>
      <h5>React and JavaScipt</h5>
      <p style = {{fontSize: 20}}>Count: {count}</p>
    </div>
  );
}

export default App;
